    class lex
    {
        
        public static ArrayList tokenlist = new ArrayList();





        public static void Lex()
        {
            string s = System.IO.File.ReadAllText("code.txt");


            int i = 0;
            string w="";
            

            while (s[i] != '$')
            {
                if (Char.IsLetter(s[i]))
                {


                    w += s[i];
                    i++;
                    while (Char.IsLetter(s[i]))
                    {
                        w += s[i];
                        i++;



                    }
                    i--;
                    switch (w)
                    {
                        case "program":
                        case "int":
                        case "float":
                        case "string":
                        case "func":
                        case "begin":
                        case "end":
                        case "while":
                        case "call":
                            tokenlist.Add(new _tokenWT(w, "RS"));
                            break;
                        default:
                            tokenlist.Add(new _tokenWT(w, "ID"));
                            break;
                    }

                }//IsLetter?
                else if (Char.IsDigit(s[i]))
                {
                    bool flag = false;

                    while (Char.IsDigit(s[i]))
                    {
                        w += s[i];
                        i++;
                        if (s[i] == '.')
                        {
                            w += s[i];
                            i++;
                            while (Char.IsDigit(s[i]))
                            {
                                w += s[i];
                                i++;
                                flag = true;
                            }

                        }

                    }//IsINT_CONST?
                    i--;
                    if (flag == false)
                    {
                        tokenlist.Add(new _tokenWT(w, "INT_CONST"));
                    }
                    else
                    {
                        tokenlist.Add(new _tokenWT(w, "FLOAT_CONST"));
                    }
                }//IsDigit?
                else if (IsOP(s[i]))
                {
                    w += s[i];
                    i++;
                    w += s[i];
                    switch (w)
                    {
                        case "<=":
                            tokenlist.Add(new _tokenWT(w, "OP"));
                            break;
                        default:
                            w = "";
                            i--;
                            w += s[i];
                            tokenlist.Add(new _tokenWT(w, "OP"));
                            break;
                    }

                    //if ( IsOP(s[i]) )
                    //{
                    //    w += s[i];
                    //    i++;
                    //    tokenlist.Add(new _tokenWT(w, "OP"));
                    //}
                    //else
                    //{

                    //    tokenlist.Add(new _tokenWT(w, "OP"));
                    //}


                }
                else if ('"' == s[i])
                {
                    i++;
                    w += s[i];
                    i++;

                    while ('"' != s[i])
                    {
                        
                        w += s[i];
                        i++;
                    }
                    tokenlist.Add(new _tokenWT(w, "STRING_CONST"));
                }

                    w = "";
                i++;
            }//while
            tokenlist.Add(new _tokenWT("$", "$"));


            PrintLex();
        }//medthod Lex

        public static bool IsOP(char c)
        {
            if ( "+-*/><=;()".Contains(c) )
            {
                return true;
            }
            else
            {
                return false;
            }
        }

        public static void PrintLex()
        {
            Console.WriteLine("\t = = = LEXICAL = = =");

            foreach (_tokenWT p in tokenlist)
            {               
                Console.WriteLine("\t {0} \t{1}", p.word, p.type);
            }
        }

















